const Home=()=>{
    let backurl="https://www.ionos.co.uk/digitalguide/fileadmin/DigitalGuide/Teaser/instagram-fuer-unternehmen-t.jpg";
    return (
        <div style={{opacity:"0.9" }}>
            <img src={backurl} style={{ width: "100%", height: "100%", top: 0, left: 0,objectFit: "cover" }} alt="Background" />
            <div style={{ color: 'black', fontSize: '16px', background: 'white' }}>Keep your memories close</div>
        </div>
    )
}
export default Home;
